        if(this.state.view === "home"){
            <Home {...props}/>
        }else if(this.state.view === "beaches"){
            <BeachShow {...props}/>
        }else if(this.state.view === "profile"){
            <UserProfile {...props}/>
        }else if(this.state.view === "contact"){
            <Contact {...props}/>
        }
    }
    render(){
        return (
            <div className="home-background">
            </div>
        )
    }
